import React from "react";
import Image from "../../login/image";
import { ContentWrapper, FlexContainer, CustomButton, ContentContainer, HeaderContainer, CenteredForm, FormContainer, Avatar, NavLink, Title, SubTitle } from "../../login/elements";
import Link from "next/link";

const Signup = () => {
  return (
    <>
      <ContentWrapper>
        <Image type="driver"/>
        <FormContainer>
          <CenteredForm>
            <HeaderContainer>
              <Title>Company Sign up</Title>
              <FlexContainer>
                <SubTitle>Already have an account?</SubTitle>
              </FlexContainer>
            </HeaderContainer>
            <ContentContainer>
              <Link href="/login/verification">
                <CustomButton>Continue</CustomButton>
              </Link>
              <FlexContainer>
                  <NavLink href="/">Need help?</NavLink>

              </FlexContainer>
            </ContentContainer>
          </CenteredForm>
        </FormContainer>
      </ContentWrapper>
    </>
  );
};

export default Signup;
